import React from 'react';

export default function AboutUs() {
  return (
    <section style={styles.page}>
      {/* Hero Section */}
      <div style={styles.heroSection}>
        <div style={styles.heroText}>
          <h1 style={styles.heroHeading}>Discover, Learn, Grow</h1>
          <p style={styles.heroSubHeading}>
            At <span style={styles.highlight}>Technagy</span>, we believe education has the power to unlock potential.
            Join a community of lifelong learners as we inspire, empower, and elevate individuals through high-quality,
            curated educational content.
          </p>
        </div>
        <div style={styles.heroImageContainer}>
          <img src="Learn.jpg" alt="Inspiration and learning" style={styles.heroImage} />
        </div>
      </div>

      {/* Mission Section */}
      <div style={styles.missionSection}>
        <h2 style={styles.sectionHeading}>Our Mission</h2>
        <p style={styles.sectionText}>
          Our mission is simple: to make learning accessible, engaging, and transformative. 
          Whether you're sharpening existing skills or diving into new domains, Technagy serves as your guide in every step of your journey.
          We provide expertly crafted content and personalized learning paths, designed for today's learners.
        </p>
        <div style={styles.missionImageContainer}>
          <img src="Student.jpg" alt="Empowering education" style={styles.missionImage} />
        </div>
      </div>

      {/* Values Section */}
      <div style={styles.valuesSection}>
        <h2 style={styles.sectionHeading}>Our Core Values</h2>
        <div style={styles.valuesGrid}>
          <div style={styles.valueItem}>
            <img src="future.jpg" alt="Innovation" style={styles.valueImage} />
            <h3 style={styles.valueTitle}>Innovation</h3>
            <p style={styles.valueText}>
              We push the boundaries of what's possible in education through technology, always seeking out creative ways to enhance learning.
            </p>
          </div>
          <div style={styles.valueItem}>
            <img src="teamwork.jpg" alt="Collaboration" style={styles.valueImage} />
            <h3 style={styles.valueTitle}>Collaboration</h3>
            <p style={styles.valueText}>
              Together, we achieve more. Collaboration with educators, institutions, and our community is at the heart of everything we do.
            </p>
          </div>
          <div style={styles.valueItem}>
            <img src="Success.jpg" alt="Empowerment" style={styles.valueImage} />
            <h3 style={styles.valueTitle}>Empowerment</h3>
            <p style={styles.valueText}>
              We empower learners to pursue their passions, build their knowledge, and transform their lives through education.
            </p>
          </div>
        </div>
      </div>

      {/* Call-to-Action Section */}
      <div style={styles.ctaSection}>
        <h2 style={styles.sectionHeading}>Join Us Today</h2>
        <p style={styles.sectionText}>
          Ready to start your learning journey? Explore our wide range of courses, designed for all skill levels, 
          and take your next step with <span style={styles.highlight}>Technagy</span>.
        </p>
        <button style={styles.ctaButton}>Explore Courses</button>
      </div>
    </section>
  );
}

// Styles using JS objects
